import React from "react";

export const Task = ({ singleTask, handleDelete }) => {
  return (
    <li id="taskCard" key={singleTask}>
      <div className="taskContent">{singleTask}</div>
      <div className="taskControl">
        <button className="delete" onClick={handleDelete}>
          Delete
        </button>
        <button className="finish">Finish</button>
      </div>
    </li>
  );
};
